import styled from "styled-components";
import CheckBox from "./CheckBox";
import { OneTodoItem } from "../model/Todo";
import Text from "./Text";

interface OneTodoProps {
  todo: OneTodoItem;
}

const OneTodo: React.FC<OneTodoProps> = ({ todo }) => {
  const { text, checked, onClick } = todo;
  console.log("todo", todo.text);
  return (
    <S.Wrapper>
      <CheckBox checked={checked} />
      <Text children={text} checked={checked} />
    </S.Wrapper>
  );
};
export default OneTodo;
const Wrapper = styled.div`
  display: flex;
  width: 100%;
  height: 30px;
  border-bottom: 1px solid #0e9aa4;
`;

const S = { Wrapper };
